import Header from './Assets/components/Header';
import ProductItem from './Assets/components/ProductItem';
import ProductData from './Data/JsonData.json';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <div className="slider"></div>
        <div className="products">
          {ProductData.map(data => 
            <ProductItem name={data.name} price={data.price} id={data.id} />
          )}
        </div>
      </main>
    </div>
  );
}

export default App;
